import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";

const { client } = vendiaClient();


export const DevicePage = () => {

    const[filteredTestList, setFilteredTestList] = useState();

    useEffect(() => {
        const filterTestList = async () => {
            const testList = await client.entities.test.list();
            const temp = testList.filter(testList => testList.Device.includes('Device1'));
            //console.log(testList?.items);
            setFilteredTestList(temp);


        }
        filterTestList();
    }, [])


    return(
        
        <div className="DevicePage">
            <table>

                 <tr>
                    <th> TestID </th>
                    <th> OrgAssignment </th>
                    <th> TestName </th>
                    <th> TestMethod </th>
                    <th> Notes </th>
                    <th> Completed </th>
                    <th> UpdatedBy </th>
                </tr>   
                
                <tbody>
                {filteredTestList?.map((test) => (
                    <tr>
                        <td> {test.TestID} </td>
                        <td> {test.OrgAssignment} </td>
                        <td> {test.TestName}</td>
                        <td> {test.TestMethod} </td>
                        <td> {test.Notes} </td>
                        <td> {test.Completed} </td>
                        <td> {test.UpdatedBy} </td>
                    </tr>
                ))}
                </tbody>
            </table>

        </div>

    )
}
